    this.getData()
  }

  componentWillUnmount() {
  }

  getData() {
    API.get().then(response => {
      const test = "HALLLOOOOOO";
      this.setState(response.data)
      /* eslint-disable no-console */
      console.log(test)
      /* eslint-disable no-console */
      console.log(this.state)
    })
  }

  render() {
    return (
      <div className="App"> TEST
      </div>
    );
  }
}

export default App;
